INSERT INTO `adminscript` (`ID`, `Descrizione`, `Testo`) VALUES
	(1, 'risistemazione applicativi su finelinea SB', '$idlinee=array(16,17,18,19,20,21,23,24,25,26,27,28,29,31,32,33,34,144,163,127,159,157,161);\r\n\r\nfor($k=0;$k<sizeof($idlinee);$k++)\r\n   {\r\n   $linea=$idlinee[$k];\r\n   mssql_query("delete from elencosw where computer=$linea");\r\n   }   \r\nfor($k=0;$k<sizeof($idlinee);$k++)\r\n   {\r\n   $linea=$idlinee[$k];\r\n   mssql_query("INSERT INTO ELENCOSW (COMPUTER,SOFTWARE,VERSIONE) VALUES ($linea, 30,\'2.14\')");\r\n   mssql_query("INSERT INTO ELENCOSW (COMPUTER,SOFTWARE,VERSIONE) VALUES ($linea, 58,\'3.0.32\')");\r\n   mssql_query("INSERT INTO ELENCOSW (COMPUTER,SOFTWARE,VERSIONE) VALUES ($linea, 69,\'2000\')");\r\n   mssql_query("INSERT INTO ELENCOSW (COMPUTER,SOFTWARE,VERSIONE) VALUES ($linea, 70,\'2000\')");\r\n   mssql_query("INSERT INTO ELENCOSW (COMPUTER,SOFTWARE,VERSIONE) VALUES ($linea, 71,\'RC11\')");\r\n   }'),
	(2, 'Conversione sw win2k', '$ris=mssql_query("update elencosw set software=70,versione=\'2000\'  where software = 1");\r\n\r\necho "righe=".mssql_rows_affected($conn);'),
	(3, 'aggiornamento sw vers.indefinita', '$ris=mssql_query("update elencosw set versione=\'?\' where versione is null");\r\n\r\necho "righe=".mssql_rows_affected($conn);'),
	(4, 'Migrazione su mysql', '$db->query ("update apparecchi set Datainst=concat(mid(Datainst1,7,4),\'-\',mid(Datainst1,4,2),\'-\',mid(Datainst1,1,2))");\r\n$db->query ("update interventi set Data=concat(mid(Data1,7,4),\'-\',mid(Data1,4,2),\'-\',mid(Data1,1,2))");\r\n$db->query ("update monitorxml set Data=concat(mid(Data1,7,4),\'-\',mid(Data1,4,2),\'-\',mid(Data1,1,2))");\r\n$db->query ("update cronologia set Data=concat(mid(Data1,7,4),\'-\',mid(Data1,4,2),\'-\',mid(Data1,1,2))");\r\n'),
	(5, 'sistemazione tabella documenti', '$db->query("update Documenti set Documento=replace(Documento,\'images/\',\'\')");\r\n$db->query("update Documenti set Documento=replace(Documento,\'docs\\\\\\\\\',\'\')");\r\n$db->query("update Documenti set Documento=replace(Documento,\'images\\\\\\\\\',\'\')");');
