	(529, 225, '2005-03-15', 'Il pc è arrivato da Interputer con problemi sul controller. Il sistema operativo segnava continuamente errori sul filesystem. Il PC è stato riportato al fornitore ed è stata cambiata la scheda madre (marca ASROCK) con una MB ASUS. <br>\r\nIL PC è stato poi portato in impianto per la messa in esercizio. <br>\r\nDa interputer aspettiamo ancora due coppie di ventole per il raffreddamento del sistema ', '15/03/2005'),
	(530, 226, '2005-03-15', 'Il pc è arrivato da Interputer con problemi sul controller. Il sistema operativo segnava continuamente errori sul filesystem. Il PC è stato riportato al fornitore ed è stata cambiata la scheda madre (marca ASROCK) con una MB ASUS. <br>\r\nIL PC è stato poi portato in impianto per la messa in esercizio. <br>\r\nDa interputer aspettiamo ancora due coppie di ventole per il raffreddamento del sistema ', '15/03/2005'),
