	(939, 164, '2010-06-25', '<p>recuperato dall\'ufficio di dall\'anese sulle baie di carico (il gabbiotto di de franceschi era stato smantellato) e riconvertito a finelinea 60</p>', NULL),
	(940, 23, '2010-06-28', '<p>Il Pc, con l\'adattatore USB aveva dei problemi di connessione che si verificavano saltuariamente nel corso della giornata e comportavano il blocco dello scarico etichette per la tracciabilit&agrave;.</p>\r\n<p>Dopo varie prove, il PC &egrave; stato sostituito con l\'ID 164. Inoltre gli &egrave; stata tolta la scheda USB e sostituita con una in standard ISA. Da oggi &egrave; in test a banco per vedere se durante il giorno perde la connessione.</p>', NULL),
	(941, 23, '2010-07-01', '<p>inserito su linea 58 per recuperare il PC di scorta; &egrave; stata inoltre sostituita la scheda netMOS, non funzionante.</p>\r\n<p>&nbsp;</p>', NULL),
	(942, 159, '2010-07-01', '<p>recuperata la scheda netMOS dalla macchina</p>', NULL),
	(943, 161, '2010-07-01', '<p>Il&nbsp;PC&nbsp;&egrave; stato verificato ed &egrave; stata aggiunta una parallela (quella onboard non funziona..)</p>\r\n<p>Dal momento che l\'area di stampa jolly presso l\'impianto 49-50 &egrave; stata smantellata, ed il nuovo posizionamento della relativa stampante &egrave; quello dell\'ufficio sulle baie di carico, il PC &egrave; stato montato li.</p>', NULL),
