	(1080, 368, '2014-03-24', '<p>Recuprato dal magazzino CED per convertirlo nella scorta impianto in considerazione del fatto che anche il Pc di supervisione &egrave; stato sostituito con lo stesso modello di PC</p>', NULL),
	(1081, 225, '2014-03-26', '<p>discontinuato</p>', NULL),
	(1082, 226, '2014-03-26', '<p>discontinuato</p>', NULL),
	(1083, 273, '2014-03-27', '<p>sostituito dal finelinea virtualizzato</p>', NULL),
	(1084, 260, '2014-03-27', '<p>discontinuato</p>', NULL),
	(1085, 243, '2014-06-03', '<p>rimesso in funzione e spedito a paese - reparto tappi per scorta alla tracciabilit&agrave; tappi</p>', NULL),
	(1086, 370, '2014-06-23', '<p>spedito in riparazione per problemi di rilevazione da parte del sensore di temperatura sulla CPU</p>', NULL),
	(1087, 372, '2014-06-23', '<p>preparato per spedizione verso Cicrespi per integrazione in macchina</p>', NULL),
	(1088, 370, '2014-07-29', '<p>tornato da riparazione; abilitato l\'AMT;</p>', NULL),
	(1089, 299, '2014-09-25', '<p>riutilizzato per sostituire il pc della supervisione Etichettatrice sleever 66</p>', NULL),
	(1090, 370, '2014-10-01', '<p>disabilitato l\'AMT (la scheda di rete &egrave; utilizzata per la comunicazione punto-punto via etherCAT con la riempitrice); riscontrati diversi errori del modulo TPM: la siemens, contattata da noi, afferma che questo &egrave; un problema normale con questa serie di macchine, ma non inficia la funzionalit&agrave; del PC.</p>\r\n<p>In ogni caso si &egrave; provveduto a disabilitare il servizio TPM; comunicato alla linea si segnalare tempestivamente eventuali altri malfunzionamenti.</p>', NULL),
	(1091, 369, '2014-10-22', '<p>modificati gli ip address e aggiornata config. OPC per inserimento in VLAN dedicata</p>', NULL),
	(1092, 268, '2014-10-22', '<p>cambiati indirizzi IP a conseguenza dell\'inserimento del networking dell\'impianto in VLAN; aggiornate le password ESCLUSO mysql per problemi di connessione con i client</p>', NULL),
	(1093, 373, '2014-11-19', '<p>riprogrammato per il montaggio su linea 42</p>', NULL),
	(1094, 370, '2014-11-26', '<p>riprogrammato per HMI linea 61 ed abilitato AMT sulla prima scheda, con indirizzo diverso dalla connettivit&agrave; normale</p>', NULL),
	(1095, 322, '2014-12-18', '<p>utilizzato da veljac&agrave; come pc per l\'ispettrice bottiglie per l\'impianto 31</p>', NULL);
